import React from "react";

export const Card = () => {
    {info.map((element) => (
        <Card
            key={element.id}
            img={element.image}
            name={element.name}
            gender={element.gender}
            status={element.status}
        />
    ))}
    return(
        <div className="card">
        <img src="" alt=""></img>
        <h3></h3>
        <p>Gender: </p>
        <p>Status: </p>
      </div>
    );
}
